import "./HomePage.css";
export default function HomePage() {
  return (
    <div className="container">
      <h1 className="text-center">TODOLIST APP BY OMKAR PEDNEKAR</h1>
      <div className="mt-10">
        <div className="main-user-div">
          <button className="pl-3">REGISTER</button>
          <button>LOGIN</button>
        </div>
      </div>
    </div>
  );
}
